def compute_count(x, N, M):
    g = math.gcd(N, M)
    lcm = (N * M) // g
    return (x // N + x // M) - 2 * (x // lcm)

def find_x(N, M, K):
    if K == 0:
        return 0
    max_nm = max(N, M)
    low = 1
    high = K * max_nm + 1
    while low < high:
        mid = (low + high) // 2
        count = compute_count(mid, N, M)
        if count < K:
            low = mid + 1
        else:
            high = mid
    return low

